  // Calculate the original signal
  assign emptyOrComplete_unbuffered = ~writeValidBuffer | (stDone0_ready & writeValidBuffer);

  // --- FANOUT FIX: Duplicate / Buffer the high-fanout signal ---
  // Create multiple copies to distribute the load
  wire emptyOrComplete_copy1;
  wire emptyOrComplete_copy2;
  
